import React from "react";

const EndGame = ( { changeGameState, exitGame, showModal } ) => {
  const showHideClassMame = showModal ? 'modal' : 'modal display-none'
  return (
    <div className={showHideClassName}>
      <button onClick={changeGameState}>
        Start another game
      </button>

      <button onClick={exitGame}>Exit game</button>
    </div>
  );
};

export default EndGame;
